import React from 'react';
import { Typography, Box, Container } from '@mui/material';
import Navbar from '../Components/Navbar'; // Import the Navbar component
import 'Blogs.css';

const Blogs = () => {
  return (
    <div className="blogs">
      {/* Navbar */}
      <Navbar />

      {/* Content Section */}
      <Container maxWidth="lg">
        <Box
          display="flex"
          flexDirection="column"
          justifyContent="center"
          alignItems="center"
          sx={{ height: '70vh', padding: '20px' }} // Match the Home layout height
        >
          <Typography variant="h3" component="h1" gutterBottom>
            Welcome to the Blogs Page
          </Typography>
          <Typography variant="body1" color="textSecondary">
            Here you will find a collection of articles and blog posts on various topics.
          </Typography>

          {/* Blog posts */}
          <Box mt={4}>
            <Typography variant="h5" component="h2">
              Blog Post 1
            </Typography>
            <Typography variant="body2" color="textSecondary">
              This is a brief description of blog post 1. It can be about any topic.
            </Typography>

            <Typography variant="h5" component="h2" sx={{ mt: 4 }}>
              Blog Post 2
            </Typography>
            <Typography variant="body2" color="textSecondary">
              This is a brief description of blog post 2. It can be about any topic.
            </Typography>

            {/* Add more blog posts as needed */}
          </Box>
        </Box>
      </Container>
    </div>
  );
};

export default Blogs;
